// Solution 1:
const rearrangeArray = (arr) => {
    let leftArr = [];
    let rightArr = [];
    for(let i=0; i<arr.length; i++){
        if(arr[i] === arr[0]){
            leftArr.push(arr[i]);
        } else {
            rightArr.unshift(arr[i]);
        }
    }
    return [...leftArr,...rightArr];
}

